        public async Task<List<AthleteClimbed>> GetAthleteClimbedsync(bool force = false)
        {
            try
            {
                if (!force)
                {
                    if (CrossConnectivity.Current.IsConnected && !Barrel.Current.IsExpired(key: UrlCartola._destaques))
                        return Barrel.Current.Get<List<AthleteClimbed>>(key: UrlCartola._destaques);
                    if (!CrossConnectivity.Current.IsConnected)
                        return Barrel.Current.Get<List<AthleteClimbed>>(key: UrlCartola._destaques);
                }

                string json = await api.Get(UrlCartola._destaques);
                json = json.Replace("D'Alessandro", "D.Alessandro");
                var saida = JsonConvert.DeserializeObject<List<AthleteClimbed>>(json.Replace("\"", "'"));
                if (saida != null)
                    Barrel.Current.Add(
                        key: UrlCartola._destaques,
                        data: saida,
                        expireIn: TimeSpan.FromMinutes(30));

                return saida;

            }
            catch (Exception ex)
            {
                return new List<AthleteClimbed>();
            }



        }

        public async Task<String> ScoreToValue(double preco_atual)
        {
            string exit = "";
            double porcent;
            double result;
            porcent = 0.45;
            result = preco_atual * porcent;
            exit = result.ToString("N2") + "pts";
            return exit;
        }

